INSERT INTO `acoes` VALUES ('cs_auto_update','Auto Atualização dos Agentes','Essa ação permite que seja realizada a auto atualização dos agentes do CACIC nos computadores onde os agentes são executados. \n\n','2006-01-23 22:05:36','T',NULL),('cs_coleta_compart','Coleta Informações de Compartilhamentos de Diretórios e Impressoras','Essa ação permite que sejam coletadas informações sobre compartilhamentos de diretórios e impressoras dos computadores onde os agentes estão instalado.','2006-01-23 22:07:55','T','COMP'),('cs_coleta_hardware','Coleta Informações de Hardware','Essa ação permite que sejam coletadas diversas informações sobre o hardware dos computadores onde os agentes estão instalados, tais como Memória, Placa de Vídeo, CPU, Discos Rígidos, BIOS, Placa de Rede, Placa Mãe, etc.','2004-09-16 16:17:42','S','HARD'),('cs_coleta_monitorado','Coleta Informações sobre os Sistemas Monitorados','Essa ação permite que sejam coletadas, nas estações onde os agentes Cacic estão instalados, as informações acerca dos sistemas previamente cadastrados na opção Administração/Cadastro/Perfís Sistemas.','2004-09-16 16:17:49','S','MONI'),('cs_coleta_officescan','Coleta Informações do Antivírus OfficeScan','Essa ação permite que sejam coletadas informações sobre o antivírus OfficeScan nos computadores onde os agentes estão instalado. São coletadas informações como a versão do engine, versão do pattern, endereço do servidor, data da instalação, etc.','2004-09-16 16:17:57','S','ANVI'),('cs_coleta_patrimonio','Coleta Informações de Patrimônio','Essa ação permite que sejam coletadas diversas informações sobre Patrimônio e Localização Física dos computadores onde os agentes estão instalados.','2004-09-16 16:18:13','S','PATR'),('cs_coleta_software','Coleta Informações de Software','Essa ação permite que sejam coletadas informações sobre a versão de diversos softwares instalados nos computadores onde os agentes são executados. São coletadas, por exemplo, informações sobre as versões do Internet Explorer, Mozilla, DirectX, ADO, BDE, DAO, Java Runtime Environment, etc.','2004-09-16 16:18:20','S','SOFT'),('cs_coleta_unid_disc','Coleta Informações sobre Unidades de Disco','Essa ação permite que sejam coletadas informações sobre as unidades de disco disponíveis nos computadores onde os agentes são executados. São coletadas, por exemplo, informações o sistema de arquivos da unidades, sua capacidade de armazenamento, ocupação, espaço livre, etc.','2004-09-16 16:18:29','S','UNDI');
